PS4本体周りをスッキリ整頓!PS4本体・コントローラー・ソフトを整理整頓できる収納スタンド!収納スタンド本体には最大12枚のソフトが収納可能なラックと上部には2台のコントローラーを充電できる充電スタンドが付属。散らかりがちなゲーム機周りの整理整頓ができます。一体感のあるデザイン!本体デザインはPS4本体との一体感あるシンプルな直線基調のデザインを採用。本体カラーもブラックにすることで、スタイリッシュかつ本体との一体感をより強調します。細かな部分にこだわり!縦置きスタンド部にはラバー加工を施し、本体収容時に傷つけず固定できるので、安定感抜群です。充電スタンドは取り外し可能!収納スタンド上部の充電スタンドは取り外しが可能な独立型でお好きな場所でコントローラを充電できます。充電用USBケーブルも付属しています。 ※充電する際は、PS4本体もしくは外部からの給電が必要です。<br><table width="800" border="0" cellspacing="0" cellpadding="0">

